{% load static %}
<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="utf-8" />
    <title>Marinesystem</title>
    <base href="/" />
    <meta name="viewport" content="width=device-width, initial-scale=1" />
    <link rel="icon" type="image/x-icon" href="favicon.ico" />
  </head>
  <body>
    <app-root></app-root>
    <script type="text/javascript" src="{% static 'runtime-es2015.js' %}" type="module"></script>
    <script type="text/javascript" src="{% static 'runtime-es5.js' %}" nomodule defer></script>
    <script type="text/javascript" src="{% static 'polyfills-es5.js' %}" nomodule defer></script>
    <script type="text/javascript" src="{% static 'polyfills-es2015.js' %}" type="module"></script>
    <script type="text/javascript" src="{% static 'styles-es2015.js' %}" type="module"></script>
    <script type="text/javascript" src="{% static 'styles-es5.js' %}" nomodule defer></script>
    <script type="text/javascript" src="{% static 'scripts.js' %}" defer></script>
    <script type="text/javascript" src="{% static 'vendor-es2015.js' %}" type="module"></script>
    <script type="text/javascript" src="{% static 'vendor-es5.js' %}" nomodule defer></script>
    <script type="text/javascript" src="{% static 'main-es2015.js' %}" type="module"></script>
    <script type="text/javascript" src="{% static 'main-es5.js' %}" nomodule defer></script>
  </body>
</html>
